import styled from 'styled-components'

export const Pubu_warpper = styled.div`
min-height:305px;
.floor{
  margin: 0 auto;
    width: 1190px;
    height:65px;
}
.floor_hit{
    position: relative;
    width: 150px;
    height: 45px;
    font-size: 28px;
    font-weight: 700;
    text-align: center;
    line-height: 45px;
    padding: 0 30px;
    margin: 0 auto 20px;
    overflow: hidden;
    color: #333;
}
.grid_c1{
  margin: 0 auto;
    width: 1190px;
}
.more2_list{
  margin:0 -5px;
}
.more2_item{
  background:#fff;
  position:relative;
  float:left;
  width:230px;
  height:322px;
  margin:0 5px 10px;
}
.img_text p{
  padding: 0 20px;
}
.img_pubu{
    width: 150px;
    height: 150px;
    margin: 30px 40px;
}
.txt_name{
  height: 48px;
    font-size: 14px;
    line-height: 24px;
    text-align: left;
    color: #666;
    -webkit-transition: color .2s ease;
    transition: color .2s ease;
    word-break: break-all;
    overflow: hidden;
    text-overflow: ellipsis;
    display: -webkit-box;
    -webkit-line-clamp: 2;
    -webkit-box-orient: vertical;
}
`
